import React from 'react';
import './NeonButton.css';

const NeonButton = ({ children, setNeonColor }) => {
  const handleMouseEnter = () => {
    if (setNeonColor) {
      setNeonColor(getRandomNeonColor());
    }
  };

  return (
    <button className="neon-button" onMouseEnter={handleMouseEnter}>
      {children}
    </button>
  );
};

export default NeonButton;
